import React from 'react';
import ReactDOM, { render } from 'react-dom';
import './index.css';

import mainLogo from './Tetris_T.png';

class Item extends React.Component{
  constructor(props){
    super(props);
    const FREE = 0;
    const DRAG = 1;

    this.state = FREE;
  }

  render(){
    const width = mainLogo.width;
    const height = mainLogo.height;
    alert(mainLogo.width);

    return(
      <div>
        <img src={mainLogo} 
          alt="Tetris T Piece" 
          
          width="140" height="100"
          style={{position: "absolute", left: width + "px"}}
          
          onClick={
            () => {
              this.state=!this.state
              alert(this.state)
            }
          }
        />

      </div>
    )
  }
}

class App extends React.Component{
    render() {
      return(
        <div>
          <Item />
        </div>
      )
    }
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
